// define a function that takes a string as input and returns an array of strings
function f_gold(s) {
    // define a helper function that takes two indices and returns an array of valid strings
    function convert(i, j) {
        var res = [];
        // iterate over all possible substrings
        for (var k = 1; k < j - i + 1; k++) {
            var left = s.substring(i, i + k);
            var right = s.substring(i + k, j);
            // check if the substring is valid
            var valid = (left == '0' || !left.startsWith('0')) && !right.endsWith('0');
            if (valid) {
                // add the valid substring to the result array
                res.push(left + (k < j - i ? '.' : '') + right);
            }
        }
        return res;
    }
    var n = s.length;
    var ans = [];
    // iterate over all possible indices
    for (var i = 2; i < n - 1; i++) {
        // iterate over all valid substrings before and after the current index
        for (var x of convert(1, i)) {
            for (var y of convert(i, n - 1)) {
                // add the valid pair of substrings to the result array
                ans.push('(' + x + ', ' + y + ')');
            }
        }
    }
    // return the result array
    return ans;
}
